import React from 'react'
import './RateCard.scss'

function RateCard({ title, imagesNo, duration }) {
  return (
    <div className='rateCardWrapper'>
        <h2 className="title">{ title }</h2>
        <h3>{ imagesNo }</h3>
        <p>{ duration }</p>
    </div>
  )
}

export default RateCard
